import { Container } from 'react-bootstrap'
import styled from 'styled-components'

const contentCard = styled(Container)`
  background-image: linear-gradient(to right, #37404E, #2F3746);
  border-radius: 15px;
  padding: 0px;
  margin-bottom: 10px
`

export default contentCard
